import React, { useEffect, useRef } from 'react';
import './css/parksPage.css';

function ParksPage({ onBackClick }) {
  const mapRef = useRef(null);

  useEffect(() => {
    const initializeMap = () => {
      const mapOptions = {
        center: { lat: 37.7749, lng: -122.4194 }, // Default center coordinates (e.g., San Francisco)
        zoom: 12, // Default zoom level
      };

      const map = new window.google.maps.Map(mapRef.current, mapOptions);

      // Add markers for parks
      const parks = [
        { name: 'Golden Gate Park', lat: 37.7694, lng: -122.4862 },
        { name: 'Dolores Park', lat: 37.7596, lng: -122.4269 },
        // Add more parks here
      ];

      parks.forEach((park) => {
        const marker = new window.google.maps.Marker({
          position: { lat: park.lat, lng: park.lng },
          map: map,
          title: park.name,
        });

        // Open Google Maps when marker is clicked
        marker.addListener('click', () => {
          window.open(`https://www.google.com/maps/search/?api=1&query=${park.lat},${park.lng}`, '_blank');
        });
      });
    };

    if (window.google && window.google.maps) {
      initializeMap();
    } else {
      const script = document.createElement('script');
      script.src = `https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY`;
      script.onload = initializeMap;
      document.head.appendChild(script);
    }
  }, []);

  return (
    <div className="parks-page-container">
      <h2>Parks Guide</h2>
      <div ref={mapRef} className="map-container"></div>
      <button className="back-button" onClick={onBackClick}></button>
    </div>
  );
}

export default ParksPage;
